import React from 'react'
import {Link} from "react-router-dom"
export default function Menu() {
  return (
    <div>

        <ul>
            <li><Link to="/shop/ss">shop</Link></li>
            <li><Link to="/about/1">about</Link></li>
            <li><Link to="/">home</Link></li>
        </ul>
    </div>
  )
}
